import AppHeader from "../appHeader/AppHeader";
import {BrowserRouter as Router,Route} from "react-router-dom";
import {MainPage,ComicsPage} from "../pages";


const App = () => {

    return (
        <Router>
            <div className="app">
                <AppHeader/>
                <main>
                    <Switch>
                        <Route exact path="/">
                            <MainPage/>
                        </Route>
                        <Route exact path="/comics">
                            <ComicsPage/>
                        </Route>
                    </Switch>
                </main>
            </div>
        </Router>
    )
}

export default App;
